import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import { defaultRouter } from "./Router";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          {defaultRouter.map((data, inx) => {
            const LayOut = data.Element;
            return <></>;
          })}
          <Route path="/" />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
